import './App.css';
import PhotoList from './components/PhotoList';

const App = () => {

  // State Variables
  const [photos, setPhotos] = useState([]);


  return (
    <div className="App">
      <header className="App-header">
        <h1 className="text-info">Photo Gallery</h1>
        <PhotoList />
      </header>
    </div>
  );
}

export default App;
